Teaser:
이 프롬프트를 사용하여 ChATGPT에서 C/C++ 프로그램을 실행하십시오. 이것은 Chatgpt를 사용하여 웹 브라우저에서 직접 모든 종류의 코딩 언어를 실행할 수 있는 매우 강력한 프롬프트입니다.

 프롬프트에 실행하려는 C 또는 C++ 코드를 입력하기만 하면 Chat-GPT가 해당 프로그램의 결과를 응답으로 제공합니다.

 이것은 PC에 컴파일러가 설치되어 있지 않고 간단한 프롬프트로 수행할 수 있는 일부 코드를 테스트하려는 경우에 유용합니다.

 C++ 코드의 예.
 #include <Istream>

